import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import ForkMenu from './forkMenu';
import BranchMenu from './branchMenu';
import NewBranchButton from './newBranchButton';

const styles = theme => ({
  root: {
    width: '100%',
    marginTop: 0,
    overflowX: 'auto',
  },
  table: {
    minWidth: 700,
  },
});


class Files extends React.Component {
  render() {
    const { classes } = this.props;
    return (
      <div className="Files">
        <div className="Actions">
          <div className="Branches" style={{display:"flex", alignItems:"center"}}>
            <BranchMenu id={this.props.id} branches={this.props.branches} getBranches={this.props.getBranches}/>
            <NewBranchButton newBranch={this.props.newBranch}/>
          </div>
          <div className="ForkMenu">
            <ForkMenu/>
          </div>
        </div>
        <Table className={classes.table}>
          <TableHead>
            <TableRow>
              <TableCell>File Name</TableCell>
              <TableCell>Last Commit</TableCell>
              <TableCell>By</TableCell>
              <TableCell>Date</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {this.props.files.map(n => {
              return (
                <TableRow key={n.id} onClick={()=>this.props.handleFile(n.id,n.name)} className="TableRow">
                  <TableCell component="th" scope="row">{n.name}</TableCell>
                  <TableCell className="ComingSoon">{"coming soon"}</TableCell>
                  <TableCell className="ComingSoon">{"coming soon"}</TableCell>
                  <TableCell className="ComingSoon">{"coming soon"}</TableCell>
                </TableRow>
              );
            })}
          </TableBody>
        </Table>
      </div>
    );
  }
}

Files.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(Files);
